I have a function for my api which uses $transaction inside of it.
I am testing it using Vitest, and for simulating requests, I've run the function 20 times using Promise.all, like so:
the function
 const verifyEmail = (data) =&gt; {
return prisma.$transaction(async tx =&gt; {
// some reading
// some updaing
})
}

test
 test("run verifyEmail multiple times", async () =&gt; {
await Promise.all(myCredentials.map(data =&gt; verifyEmail(data)))
})

and the error I get:
 Transaction API error: Unable to start a transaction in the given time.

I won't get error if the myCrendentials only have 12 items. but if the items increased to more than 12, prisma throws the above error.
any idea why this happens?
p.s. increasing the timeout and maxWait didn't help
 edit:
I think I found the problem.
I am making some queries in prisma middleware.
so it throws this error because somehow the queries inside of middleware are using the main prisma client BUT inside a transaction.
still searching...

The last chapter explained the standard input and output devices handled by C programming language. This chapter cover how C programmers can create, open, close text or binary files for their data storage.
A file represents a sequence of bytes, regardless of it being a text file or a binary file. C programming language provides access on high level functions as well as low level (OS level) calls to handle file on your storage devices. This chapter will take you through the important calls for file management.
Opening Files
You can use the fopen( ) function to create a new file or to open an existing file. This call will initialize an object of the type FILE, which contains all the information necessary to control the stream. The prototype of this function call is as follows ‚àí
FILE *fopen( const char * filename, const char * mode );
Here, filename is a string literal, which you will use to name your file, and access mode can have one of the following values ‚àí

Sr.No.
Mode &amp; Description
1
  r 
Opens an existing text file for reading purpose. 
2
  w 
Opens a text file for writing. If it does not exist, then a new file is created. Here your program will start writing content from the beginning of the file. 
3
  a 
Opens a text file for writing in appending mode. If it does not exist, then a new file is created. Here your program will start appending content in the existing file content. 
4
  r+ 
Opens a text file for both reading and writing. 
5
  w+ 
Opens a text file for both reading and writing. It first truncates the file to zero length if it exists, otherwise creates a file if it does not exist. 
6
  a+ 
Opens a text file for both reading and writing. It creates the file if it does not exist. The reading will start from the beginning but writing can only be appended. 

If you are going to handle binary files, then you will use following access modes instead of the above mentioned ones ‚àí
"rb", "wb", "ab", "rb+", "r+b", "wb+", "w+b", "ab+", "a+b"
Closing a File
To close a file, use the fclose( ) function. The prototype of this function is ‚àí
int fclose( FILE *fp );
The fclose(-) function returns zero on success, or EOF if there is an error in closing the file. This function actually flushes any data still pending in the buffer to the file, closes the file, and releases any memory used for the file. The EOF is a constant defined in the header file stdio.h.
There are various functions provided by C standard library to read and write a file, character by character, or in the form of a fixed length string.
Writing a File
Following is the simplest function to write individual characters to a stream ‚àí
int fputc( int c, FILE *fp );
The function fputc() writes the character value of the argument c to the output stream referenced by fp. It returns the written character written on success otherwise EOF if there is an error. You can use the following functions to write a null-terminated string to a stream ‚àí
int fputs( const char *s, FILE *fp );
The function fputs() writes the string s to the output stream referenced by fp. It returns a non-negative value on success, otherwise EOF is returned in case of any error. You can use int fprintf(FILE *fp,const char *format, ...) function as well to write a string into a file. Try the following example.
Make sure you have /tmp directory available. If it is not, then before proceeding, you must create this directory on your machine.
#include &lt;stdio.h&gt;
main() {
FILE *fp;
fp = fopen("/tmp/test.txt", "w+");
fprintf(fp, "This is testing for fprintf...\n");
fputs("This is testing for fputs...\n", fp);
fclose(fp);
}
When the above code is compiled and executed, it creates a new file test.txt in /tmp directory and writes two lines using two different functions. Let us read this file in the next section.
Reading a File
Given below is the simplest function to read a single character from a file ‚àí
int fgetc( FILE * fp );
The fgetc() function reads a character from the input file referenced by fp. The return value is the character read, or in case of any error, it returns EOF. The following function allows to read a string from a stream ‚àí
char *fgets( char *buf, int n, FILE *fp );
The functions fgets() reads up to n-1 characters from the input stream referenced by fp. It copies the read string into the buffer buf, appending a null character to terminate the string.
If this function encounters a newline character '\n' or the end of the file EOF before they have read the maximum number of characters, then it returns only the characters read up to that point including the new line character. You can also use int fscanf(FILE *fp, const char *format, ...) function to read strings from a file, but it stops reading after encountering the first space character.
#include &lt;stdio.h&gt;
main() {
FILE *fp;
char buff[255];
fp = fopen("/tmp/test.txt", "r");
fscanf(fp, "%s", buff);
printf("1 : %s\n", buff );
fgets(buff, 255, (FILE*)fp);
printf("2: %s\n", buff );
fgets(buff, 255, (FILE*)fp);
printf("3: %s\n", buff );
fclose(fp);
}
When the above code is compiled and executed, it reads the file created in the previous section and produces the following result ‚àí
1 : This
2: is testing for fprintf...
3: This is testing for fputs...
Let's see a little more in detail about what happened here. First, fscanf() read just This because after that, it encountered a space, second call is for fgets() which reads the remaining line till it encountered end of line. Finally, the last call fgets() reads the second line completely.
Binary I/O Functions
There are two functions, that can be used for binary input and output ‚àí
size_t fread(void *ptr, size_t size_of_elements, size_t number_of_elements, FILE *a_file);
size_t fwrite(const void *ptr, size_t size_of_elements, size_t number_of_elements, FILE *a_file);
Both of these functions should be used to read or write blocks of memories - usually arrays or structures.

Table of contents   Total count   Frequency count   Error handling   Example 1   Example 2      Programming in C is a very important baseline skill for CS 162. This exercise should make sure you‚Äôre comfortable with the basics of the language. In particular, you need to be fluent in working with structs, linked data structures (e.g., lists), pointers, arrays, typedef and such, which CS 61C may have touched only lightly. You will be writing a program called words. words is a program that counts (1) the total amount of words and (2) the frequency of each word in a file(s). It then prints the results to stdout. Like most UNIX utilities in the real world, your program should read its input from each of the files specified as command line arguments, printing the cumulative word counts. If no file is provided, your program should read from stdin. In C, header files (suffixed by .h) are how we engineer abstractions. They define the objects, types, methods, and‚Äîmost importantly‚Äîdocumentation. The corresponding .c file provides the implementation of the abstraction. You should be able to write code with the header file without peeking under the covers at its implementation. In this case, words/word_count.h provides the definition of the word_count struct, which we will use as a linked list to keep track of a word and its frequency. This has been typedef‚Äôd into WordCount. This means that instead of typing out struct word_count, we can use WordCount as shorthand. The header file also gives us a list of functions that are defined in words/word_count.c. Part of this assignment is to write code for these functions in words/word_count.c  We have provided you with a compiled version of sort_words so that you do not need to write the wordcount_sort function. However, you may still need to write your own comparator function (i.e. wordcount_less). The Makefile links this in with your two object files, words.o and word_count.o. Note that words.o is an ELF formatted binary. As such you will need to use a system which can run ELF executables to test your program (such as the CS 162 VM). Windows and OS X do NOT use ELF and as such should not be used for testing. For this section, you will be making changes to words/main.c and words/word_count.c. After editing these files, cd into the words directory and run make in the terminal. This will create the words executable. (Remember to run make after making code changes to generate a fresh executable). Use this executable (and your own test cases) to test your program for correctness. The autograder will use a series of test cases to determine your final score for this section. For the below examples, suppose we have a file called words.txt that contains the following content:   abc def AaA
bbb zzz aaa
a
     Note 1: Using functions such as rewind and fseek will cause some issues with stdin that might not be apparent when testing locally, so you should avoid using those in your implementation.     Note 2: Use appropriate macros from stdio.h whenever possible. These include stdin/stdout and EOF.      Total count Your first task will be to implement total word count. When executed, words will print the total number of words counted to stdout. At this point, you will not need to make edits to word_count.c. A complete implementation of the num_words() function along with the appropiate changes to main.c can suffice.  A word is defined as a sequence of contiguous alphabetical characters of length greater than one. All words should be converted to their lower-case representation and be treated as not case-sensitive. The maximum length of a word has been defined at the top of main.c. After completing this part, running ./words words.txt should print:   The total number of words is: 6
   Remember to support input from multiple files and standard input! Running ./words words.txt words.txt should print:   The total number of words is: 12
   To test reading from standard input, check that ./words &lt; words.txt prints:   The total number of words is: 6
   As final sanity check, printf hi | ./words should print:   The total number of words is: 1
      Frequency count Your second task will be to implement frequency counting. Your program should print each unique word as well as the number of times it occurred. This should be sorted in order of frequency (low first). The alphabetical ordering of words should be used as a tie breaker. The wordcount_sort function has been defined for you in wc_sort.o. However, you will need to implement the wordcount_less function in main.c. To address a common issue observed in previous semesters, beware that wordcount_sort may make use of init_words to initialize an empty word list. Make sure that your init_words is sufficiently abstract to provide the intended functionality. You will need to implement the functions in word_count.c to support the linked list data structure (i.e. WordCount a.k.a. struct word_count). The complete implementation of word_count.c will prove to be useful when implementing count_words() in main.c. After completing this part, running ./words -f words.txt should print:   1 abc
1 bbb
1 def
1 zzz
2 aaa
    Hint: You can run the code below to verify the basic functionality of your program (don‚Äôt treat this as a testing spec though):    cat &lt;filename&gt;
| tr " " "\n"
| tr -s "\n"
| tr "[:upper:]" "[:lower:]"
| tr -d -C "[:lower:]\n"
| sort
| uniq -c
| sort -n
      Error handling In this course, you should get accustomed to writing code defensively. More specifically, you should always include error handling code such that your code does not panic or segfault in the event of errors. In this assignment, you will implement several functions, all of which have docstrings indicating what you should return if an error occurs during execution of the function. Make sure that whenever you call these functions in the rest of your code, you check the returned value and handle error cases appropriately. In addition to handling errors, it is always good practice to perform argument validation at the beginning of a function. A simple example of argument validation is ensuring that pointers are not NULL. Below are a few examples of naive code and their counterparts that handle errors appropriately.    Example 1  Without error handling:    char *new_string(char *str) {
return strcpy((char *) malloc(strlen(str) + 1), str);
}
    malloc can potentially return a null pointer. If that happens, we will be passing a null pointer as the destination argument to strcpy, which expects a non-null buffer.  With error handling:    char *new_string(char *str) {
char *new_str = (char *) malloc(strlen(str) + 1);
if (new_str == NULL) {
return NULL;
}
return strcpy(new_str, str);
}
   Here, we decide explicitly how we want to handle the case where malloc returns a null pointer. Since the function returns a char *, it‚Äôs reasonable to return NULL (note that in this assignment, we will be clear about what you should return in error cases). Note that the caller of this function should do error handling of its own by checking if the return value of new_string is NULL.    Example 2  Without error handling:    int main(int argc, char *argv[]) {
FILE *input_file;
...
char *file_name = ...
input_file = fopen(file_name, "r");
// Perform some logic using input_file.
}
   Here, we perform some downstream tasks under the implicit assumption that the call to fopen succeeded and that input_file is a valid FILE *. But what if fopen fails? For example, the file with name file_name may not exist. In that case, input_file will be NULL. If we try to dereference input_file later, we can segfault or even encounter other undefined behavior which can lead to an uncontrolled crash of our program.  With error handling:    int main(int argc, char *argv[]) {
FILE *input_file;
...
char *file_name = ...
input_file = fopen(file_name, "r");
if (input_file == NULL) {
fprintf(stderr, "File does not exist.\n");
return 1;
}
// Perform some logic using input_file.
}
   Here, we address the case where fopen fails and print a helpful error message before returning the error code 1, which will get propagated to main‚Äôs caller and allow for controlled exit of the program.

function
&lt;cstring&gt;
strncat
 char * strncat ( char * destination, const char * source, size_t num ); 
Append characters from string
Appends the first num characters of source to destination, plus a terminating null-character.
If the length of the C string in source is less than num, only the content up to the terminating null-character is copied. 
Parameters
destination
Pointer to the destination array, which should contain a C string, and be large enough to contain the concatenated resulting string, including the additional null-character.
source
C string to be appended.
num
Maximum number of characters to be appended.
size_t is an unsigned integral type.
Return Value
destination is returned.
Example
      1234567891011121314   
   /* strncat example */
#include &lt;stdio.h&gt;
#include &lt;string.h&gt;
int main ()
{
char str1[20];
char str2[20];
strcpy (str1,"To be ");
strcpy (str2,"or not to be");
strncat (str1, str2, 6);
puts (str1);
return 0;
}  

